import React from "react";
import ReactDOM from "react-dom";
import GeneralSorting from "./sorting/GeneralSorting"
import "./index.css";
import * as serviceWorker from './serviceWorker';

ReactDOM.render(<GeneralSorting name="Welcome to Sorting application!"/>, document.getElementById("root"));
var eee = ReactDOM.findDOMNode(this.refs['root']).getBoundingClientRect();
ReactDOM.render(<GeneralSorting name="Welcome to Sorting 000 application!"/>, document.getElementById("kot"));
var fff = ReactDOM.findDOMNode(this.refs['kot']).getBoundingClientRect();
serviceWorker.unregister();
